import FocusedUserList from "./focusedUserList"
import FocusedDeviceList from "./focusedDeviceList"

export default function focusedCases(data, type, profile) {
  let temp = []
  let tempProfile = {"profile": profile, "users": "", "lines": "", "blfs": ""}
  switch(type) {
    case "users":
      temp = []
      tempProfile = {"profile": profile, "users": "", "lines": "", "blfs": ""}
      data.resources[0].data.Phone.forEach(e => {
        tempProfile['users'] = [...tempProfile['users'], e.name]
        
        if (e.lines) {
          temp = []
          e.lines.line.forEach((i) => temp = [...temp, i.label])
          tempProfile['lines'] = [...tempProfile['lines'], temp]
        }

        if (e.busyLampFields) {
          temp = []
          e.busyLampFields.busyLampField.forEach(i => temp = [...temp, `${i.label} - ${i.blfDest}`])
          tempProfile['blfs'] = [...tempProfile['blfs'], temp]
        }

        try {e.busyLampFields.busyLampField.forEach(i => tempProfile['blfs'] = [...tempProfile['blfs'], `${i.label} - ${i.blfDest}`])}
        catch {/*BLF's do not exist*/}
      })

      return <FocusedUserList profile={tempProfile}/>

    case "phones":
      temp = []
      tempProfile = {"profile": profile, "users": [], "lines": [], "blfs": []}

      try {
        data.resources[0].data.lines.line.forEach(e => {
          temp = [...temp, e.dirn.pattern]
          tempProfile['lines'] = [...tempProfile['lines'], e.dirn.pattern]
        })
      }
      catch {/*Lines do not exist*/}
      
      try {data.resources[0].data.busyLampFields.busyLampField.forEach(() => tempProfile['blfs'] = [...tempProfile['blfs'], temp])}
      catch {/*BLF's do not exist*/}
      
      try {data.resources[0].data.speeddails.speeddail.forEach(() => tempProfile['blfs'] = [...tempProfile['blfs'], temp])}
      catch {/*Speeddails do not exit*/}

      return <FocusedDeviceList meta={data} profile={tempProfile}/>
  }
}
